  false,\n\t\"url\": null,\n\t\"notes\": \"It allows to generate tables for Low-Income
  Housing Tax Credit (LIHTC) Qualified Census Tracts (QCT) and for Difficult Development
  Areas (DDA). LIHTC Qualified Census Tracts must have 50 percent of households with
  incomes below 60 percent of the Area Median Gross Income (AMGI) or have a poverty
  rate of 25 percent or more. DDA are designated by HUD and are based on Fair Market
  Rents, income limits, and the 2000 Census counts.\",\n\t\"license_title\": \"License
